import React, { Fragment } from "react";
import { Gradient } from "react-gradient";

const About = () => {
  const gradients = [
    ["#59c2ff", "#1270e3"],
    ["#8739e5", "#ff63de"]
  ];
  return (
    <Gradient
      gradients={gradients}
      property='background'
      duration={8000}
      angle='45deg'
    >
      <Fragment>
        <div className='pt-5 pb-5'>
          <div className='container'><span className='badge badge-danger'>Currently in development! </span></div>
          <div className='d-flex justify-content-center'>
            <h1 className='display-4 text-center'>Aleksandr Shchilkin</h1>
          </div>
          <div className='d-flex display-4 justify-content-center'>
            <h1>IT Student</h1>
          </div>
        </div>
      </Fragment>
    </Gradient>
  );
};

export default About;
